import React from 'react'
import Navbar from './Navbar'
import { Box } from "@material-ui/core"
import { makeStyles } from "@material-ui/core/styles";
import { Card, CardHeader, CardMedia, Grid, Paper } from "@material-ui/core";
import { Typography } from "@material-ui/core"
import Avatar from '@material-ui/core/Avatar';
import cardData from './cardData'

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    skillCards: {
        maxWidth: 260,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
    media: {
        height: 0,
        paddingTop: '70%', // 16:9
    },
    avatar: {
        backgroundColor: "#27496d",
    },
    heading: {
        color: "#142850",
        padding: "2rem 0",
        textTransform: "uppercase"
    },
}));

const Portfolio = () => {
    const classes = useStyles();

    const [spacing, setSpacing] = React.useState(2);

    return (
        <Box component="div">
            <Navbar />
            <Typography className={classes.heading} variant="h4" align="center">
                Technical Skills
            </Typography>
            <div className={classes.root}>
                <Grid container spacing={2}>
                {cardData.map((card) => (
                    <Grid item xs={3} >
                        <Card className={classes.skillCards}>
                        <CardHeader
                            avatar={
                                <Avatar aria-label="recipe" className={classes.avatar}>{card.letter}</Avatar>
                            }
                            title={card.title}
                            subheader={"Experience: "+card.years}
                        />
                        <CardMedia
                            className={classes.media}
                            image={card.img}
                            title={card.title}
                        />
                        </Card>
                    </Grid>
                ))}
                    <Grid item xs={3}>
                    <Card className={classes.skillCards}>
                        <CardHeader
                            avatar={
                                <Avatar aria-label="recipe" className={classes.avatar}>C</Avatar>
                            }
                            title="CSS3"
                            subheader="Experience: 3 years"
                        />
                        <CardMedia
                            className={classes.media}
                            image="/images/tile2.png"
                            title="HTML"
                        />
                        </Card>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper className={classes.paper}>xs=3</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper className={classes.paper}>xs=3</Paper>
                    </Grid>
                </Grid>
            </div>
        </Box>
    )
}

export default Portfolio
